import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { 
  ClipboardDocumentListIcon,
  CurrencyDollarIcon,
  ClockIcon,
  CheckCircleIcon,
  StarIcon,
  CalendarIcon,
  UserGroupIcon,
  TrendingUpIcon,
  BellIcon,
  MapPinIcon,
  PhoneIcon,
  ArrowRightIcon
} from '@heroicons/react/24/outline';

const Dashboard = () => {
  const [stats, setStats] = useState({
    totalBookings: 45,
    completedBookings: 38,
    pendingBookings: 3,
    todayEarnings: 2500,
    totalEarnings: 45000,
    averageRating: 4.8
  });

  const [recentBookings, setRecentBookings] = useState([
    {
      _id: '1',
      customerName: 'John Doe',
      service: { name: 'Home Cleaning' },
      status: 'pending',
      scheduledDate: new Date(),
      pricing: { totalAmount: 1500 }
    },
    {
      _id: '2',
      customerName: 'Jane Smith',
      service: { name: 'Plumbing Service' },
      status: 'completed',
      scheduledDate: new Date(),
      pricing: { totalAmount: 2000 }
    }
  ]);

  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Simulate API call
    const timer = setTimeout(() => {
      setLoading(false);
    }, 1000);

    return () => clearTimeout(timer);
  }, []);

  if (loading) {
    return (
      <div className="flex justify-center items-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="bg-white shadow rounded-lg p-6">
        <h1 className="text-3xl font-bold text-gray-900">Welcome back, Partner!</h1>
        <p className="text-gray-600 mt-2">Here's what's happening with your business today</p>
      </div>

      {/* Stats Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        <div className="bg-white rounded-lg shadow p-6">
          <div className="flex items-center">
            <div className="p-3 bg-blue-100 rounded-full">
              <ClipboardDocumentListIcon className="h-6 w-6 text-blue-600" />
            </div>
            <div className="ml-4">
              <p className="text-sm text-gray-500">Total Bookings</p>
              <p className="text-2xl font-semibold text-gray-900">{stats.totalBookings}</p>
            </div>
          </div>
        </div>

        <div className="bg-white rounded-lg shadow p-6">
          <div className="flex items-center">
            <div className="p-3 bg-green-100 rounded-full">
              <CheckCircleIcon className="h-6 w-6 text-green-600" />
            </div>
            <div className="ml-4">
              <p className="text-sm text-gray-500">Completed</p>
              <p className="text-2xl font-semibold text-gray-900">{stats.completedBookings}</p>
            </div>
          </div>
        </div>

        <div className="bg-white rounded-lg shadow p-6">
          <div className="flex items-center">
            <div className="p-3 bg-purple-100 rounded-full">
              <CurrencyDollarIcon className="h-6 w-6 text-purple-600" />
            </div>
            <div className="ml-4">
              <p className="text-sm text-gray-500">Today's Earnings</p>
              <p className="text-2xl font-semibold text-gray-900">₹{stats.todayEarnings}</p>
            </div>
          </div>
        </div>
      </div>

      {/* Recent Bookings */}
      <div className="bg-white shadow rounded-lg p-6">
        <div className="flex justify-between items-center mb-6">
          <h2 className="text-lg font-medium text-gray-900">Recent Bookings</h2>
          <Link to="/bookings" className="text-sm font-medium text-blue-600 hover:text-blue-500">
            View all
          </Link>
        </div>
        
        <div className="space-y-4">
          {recentBookings.map((booking) => (
            <div key={booking._id} className="border-b border-gray-200 pb-4 last:border-0 last:pb-0">
              <div className="flex items-center">
                <div className="flex-1">
                  <p className="text-sm font-medium text-gray-900">{booking.customerName}</p>
                  <p className="text-sm text-gray-500">{booking.service?.name}</p>
                </div>
                <div className="ml-4">
                  <span className={`px-2 py-1 text-xs rounded-full ${
                    booking.status === 'completed' 
                      ? 'bg-green-100 text-green-800' 
                      : booking.status === 'pending'
                      ? 'bg-yellow-100 text-yellow-800'
                      : 'bg-blue-100 text-blue-800'
                  }`}>
                    {booking.status}
                  </span>
                </div>
              </div>
              <div className="mt-2 flex justify-between items-center">
                <div className="text-sm text-gray-500">
                  {booking.scheduledDate && new Date(booking.scheduledDate).toLocaleDateString()}
                </div>
                <div className="text-sm font-medium">
                  ₹{booking.pricing?.totalAmount || '0'}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
